// 압축된 서비스 데이터
var COMPRESSED_SERVICE_DATA = "";

// 데이터 해제 함수
function loadServiceData() {
    try {
        console.log('[DATA_SERVICE] 데이터 해제 시작...');
        
        // pako 라이브러리 확인
        if (typeof pako === 'undefined') {
            console.warn('[DATA_SERVICE] pako 라이브러리 대기 중...');
            setTimeout(loadServiceData, 100); // 100ms 후 재시도
            return;
        }
        
        // base64 디코딩
        const binaryString = atob(COMPRESSED_SERVICE_DATA);
        const bytes = new Uint8Array(binaryString.length);
        for (let i = 0; i < binaryString.length; i++) {
            bytes[i] = binaryString.charCodeAt(i);
        }
        
        // gzip 해제
        const decompressed = pako.ungzip(bytes, { to: 'string' });
        
        // JSON 파싱
        window.SERVICE_DATA = JSON.parse(decompressed);
        
        console.log('[DATA_SERVICE] ✅ 데이터 로딩 완료: ' + SERVICE_DATA.length.toLocaleString() + '건');
        
        // 첫 번째 레코드 샘플 출력
        if (SERVICE_DATA.length > 0) {
            console.log('[DATA_SERVICE] 샘플:', SERVICE_DATA[0]);
        }
        
    } catch (error) {
        console.error('[DATA_SERVICE] ❌ 데이터 해제 실패:', error);
        // 에러 발생 시 재시도 (최대 5초)
        if (!window.DATA_SERVICE_RETRY_COUNT) {
            window.DATA_SERVICE_RETRY_COUNT = 0;
        }
        window.DATA_SERVICE_RETRY_COUNT++;
        
        if (window.DATA_SERVICE_RETRY_COUNT < 50) {
            console.log('[DATA_SERVICE] 재시도 중... (' + window.DATA_SERVICE_RETRY_COUNT + '/50)');
            setTimeout(loadServiceData, 100);
        } else {
            alert('데이터 로딩에 실패했습니다. 페이지를 새로고침 해주세요.');
        }
    }
}

// 페이지 로드 후 실행
if (document.readyState === 'loading') {
    document.addEventListener('DOMContentLoaded', loadServiceData);
} else {
    loadServiceData();
}
